// 1. 先設一個很大的空間 (例如 200KB)，確保 Allocate 一定成功
// 等跑完一次後，看 Log 印出的 "Arena Used Bytes" 是多少，下次改回來即可省空間
const int kTensorArenaSize = 100 * 1024; 
alignas(16) uint8_t tensor_arena[kTensorArenaSize];

int main(int argc, char* argv[]) {
    printf("\r\n=== FPGA VWW Person Detection ===\r\n");

    tflite::MicroErrorReporter micro_error_reporter;
    const tflite::Model* model = tflite::GetModel(g_model);
    if (model->version() != TFLITE_SCHEMA_VERSION) return 1;

    tflite::MicroMutableOpResolver<10> resolver;
    resolver.AddFullyConnected();
    resolver.AddRelu();
    resolver.AddConv2D();
    resolver.AddDepthwiseConv2D();
    resolver.AddReshape();
    resolver.AddSoftmax();
    resolver.AddAveragePool2D();
    resolver.AddLogistic();

    tflite::MicroInterpreter interpreter(model, resolver, tensor_arena, kTensorArenaSize);

    if (interpreter.AllocateTensors() != kTfLiteOk) {
        printf("Allocate Failed! Tensor Arena is too small.\r\n");
        return 1;
    }

    size_t used_bytes = interpreter.arena_used_bytes();
    printf("[Memory] Arena Used Bytes: %d\r\n", (int)used_bytes);
    printf("[Memory] Tensor Arena Size : %d\r\n", kTensorArenaSize);

    TfLiteTensor* input = interpreter.input(0);
    TfLiteTensor* output = interpreter.output(0);

    if (sizeof(input_data) <= input->bytes) {
        std::memcpy(input->data.int8, input_data, input->bytes);
    } else {
        std::memset(input->data.int8, 0, input->bytes);
    }

    printf("Running Inference...\r\n");

    uint64_t start_cyc = get_timer_value();
    TfLiteStatus invoke_status = interpreter.Invoke();
    uint64_t end_cyc = get_timer_value();

    if (invoke_status != kTfLiteOk) {
        printf("Inference Failed!\r\n");
        return 1;
    }

    uint64_t duration = end_cyc - start_cyc;
    int8_t score_not_person = output->data.int8[0];
    int8_t score_person     = output->data.int8[1];

    float scale = output->params.scale;
    int32_t zero_point = output->params.zero_point;

    float conf_not_person = (score_not_person - zero_point) * scale * 100.0f;
    float conf_person     = (score_person - zero_point) * scale * 100.0f;

	printf("\r\n=== Result ===\r\n");

    int conf_p_int = (int)conf_person;
    int conf_p_dec = (int)((conf_person - conf_p_int) * 100); // 取小數後兩位

    int conf_np_int = (int)conf_not_person;
    int conf_np_dec = (int)((conf_not_person - conf_np_int) * 100);

    printf("Person     : %d (%d.%02d%%)\r\n", score_person, conf_p_int, abs(conf_p_dec));
    printf("Not Person : %d (%d.%02d%%)\r\n", score_not_person, conf_np_int, abs(conf_np_dec));
    
    if (score_person > score_not_person) {
        printf("Verdict: [ PERSON ]\r\n");
    } else {
        printf("Verdict: [ NO PERSON ]\r\n");
    }

    printf("\r\n=== Performance ===\r\n");
    if (duration > 4294967295U) {
        printf("Cycles: %u%09u\r\n", (uint32_t)(duration / 1000000000), (uint32_t)(duration % 1000000000));
    } else {
        printf("Cycles: %u\r\n", (uint32_t)duration);
    }
    printf("Time (20MHz): %u ms\r\n", (uint32_t)(duration / 20000));
    printf("======================================\r\n");

    while (1) {}
    return 0;
}